import React from 'react';
import logo from './logo.svg';
import './App.css';
import App1 from './CamposCadastro.js'
import Lista from './CamposCadastro.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="row justify-content-right">
          Api UI
        </p>
        <App1></App1>
        <Lista Lista={this.state.Lista} />
      </header>
    </div>
  );
}


// App component

export default App;
